\u0412\u043e\u043f\u0440\u043e\u0441 116.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Отдельного младенца добавили в 1980 году после смерти Джона Леннона;
надпись на нимбе - "Lennon lives" ("Леннон жив"), а на доске внизу -
фрагмент его песни "Imagine" ("Представь").

\u0412\u043e\u043f\u0440\u043e\u0441 50.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Запах полыни дольше напоминает космонавтам о земле во время полета;
Королев не любил старты по понедельникам; 24 октября 1960 года на
стартовом столе Байконура произошел взрыв ракеты-носителя.

\u0412\u043e\u043f\u0440\u043e\u0441 24.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Нетрудно догадаться, что персонажи - зайчики; кстати, здесь Чику на
помощь тоже приходит доктор Айболит и пришивает ему оторванную лапку;
мультфильм так и называется - "Зай и Чик".

\u0412\u043e\u043f\u0440\u043e\u0441 15.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
В последнем, четвертом упражнении надо разрубить топором бревно,
находящееся в вертикальном положении, - действительно, последний рубеж;
мы с вами тоже подошли к последнему рубежу в поединке за первое место.
